const DeleteData = async (id, refreshData) => {
  try {
    const response = await fetch(
      `https://6743ce15b7464b1c2a65e803.mockapi.io/GHI/${id}`,
      { method: 'DELETE' }
    );
    if (response.ok) {
      console.log('데이터 삭제 성공');
      refreshData(); // 데이터 갱신
    } else {
      console.error(`데이터 삭제 실패: ${response.status}`);
    }
  } catch (error) {
    console.error('데이터 삭제 중 오류 발생:', error);
  }
};
